INSERT INTO `properties` VALUES
(64,1000720659,'Fully Furnished 1 Bedroom Unit in Signa Designer Residences','1227, Metro Manila, Makati, Signa Designer Residences, Valero St',40000.00,'Condo','Signa Designer Residences is one of the luxuria projects of Robinsons Land Corporation. It has the best location in the prime business district in Metro Manila.\r\n\r\nMajor financial headquarters, embassies, law firms, and Makati stock exchanges are just a few steps away from Signa Designer Residences’ driveway.\r\n\r\nThe unit is located on the 6th floor. It is fully furnished with comfortable and durable furniture and fixture. It has a balcony for added space and open area.\r\n\r\nNearby establishments within less than 1 kilometer:\r\nYuchengco building, PBCom Tower, Makati spots club, Philam Life building, Ayala Triangle Garden, Pag-ibig (HDMF) Makati office.',1,'None',1,1,'Available','2025-05-15 11:31:04','Approved',2000786242,14.55922320,121.01912230),
(65,1000845370,'Fully Furnished 1 bedroom for rent in Aseana Paranaque City Manila','Aseana, Bradco Avenue,Metro Manila',50000.00,'Condo','To highlight a few basic features Fully 1 bedroom for rent in Aseana Paranaque City Manila:\r\nIntercom\r\nHot shower system\r\nInduction cooktop\r\nFlat screen TV\r\nBuilt-in wardrobe\r\nQueensize bed\r\nSome upgrades in the unit\r\n\r\nShelving in the living room and in the bedroom\r\n7cuft fridge\r\nCeiling fan\r\nKitchen and dining ware\r\nRug, decors and painting',1,'None',1,1,'Available','2025-05-15 12:02:21','Approved',2000622197,14.52895280,120.99177160),
(66,1000554533,'Fully Furnished 1 Bedroom in Jazz Residences Metro Manila','Jazz Residences, Makati City',30000.00,'Condo','Fully furnished, very comfortable bed and optimized furniture.\r\nBalcony view is relaxing and mesmerizing especially during at night.\r\nSplit-type airconditioning unit\r\nWater heater system installed in shower\r\nConvertible coffee table to dining table\r\nComplete dining and cooking wares included\r\nWashing machine\r\nFlat screen TV and comfortable size fridge\r\nEasily accessible to public transport\r\nConvenience shops located at the ground level\r\nJazz mall with various restaurants, supermarket, BDO bank and other convenience',1,'None',1,1,'Available','2025-05-15 12:15:48','Occupied',2000719074,14.56383330,121.02178200),
(67,1000554533,'1 bedroom with parking in Sapphire Bloc condominium in Ortigas, Mandaluyong','Starbucks, Sapphire Road, San Antonio, Pasig First District, Pasig, Eastern Manila District, Metro Manila, 1605, Philippines',34000.00,'Condo','A proud project of Robinsons Land Corporation! Fully furnished 1 bedroom with parking in Sapphire Bloc, get this condo for rent in Ortigas, Mandaluyong\r\nThis property is literally at the back of Robinsons Galleria which means you have access to BPO offices, restaurants, banks, schools and other business establishments. It also a few minutes walk towards the MRT Ortigas station and just a few steps from shuttle services, point-to-point bus services, city buses, and other commute transportation.\r\n\r\nSapphire Bloc is proud of its proximity to major business hubs within Ortigas central business. Resident in Sapphire Bloc can just walk anywhere in Ortigas CBD thereby avoiding traffic congestion.\r\n\r\nLiving in this modern condo for rent will gain you access to one of the best condominium amenities you can imagine. They have 2 swimming pools and a lap pool. They also have an equipped fitness center, and a sprawling landscaped garden.\r\n\r\nThis rent 1 bedroom with parking in Sapphire Bloc condominium in Ortigas, Mandaluyong is fully furnished and ready for move-in anytime. This unit comes with a very nice kitchen equipped with cabinets, dining and cooking ware, perfect for your daily needs. It also has a nice wooden 2-seater dining table. It also has a 2-seater sofa along with a beautiful wooden TV console. The unit is professionally designed.\r\n \r\nThis 1 bedroom unit is located on the 4th floor North wing of Sapphire Bloc Residences.\r\n \r\nNearby establishments are Robinsons Galleria, Security and Exchange Commission, Robinsons Cyber Beta Building, Pacific Hub Corporation, Marco Polo Hotel and Union Bank Plaza\r\n\r\n \r\nFeatures of rent 1 bedroom with parking in Sapphire Bloc condominium in Ortigas, Mandaluyong:\r\n\r\n1 bedroom\r\n1 toilet\r\nHot water system\r\nWindow type aircon unit\r\nToilet with lavatory\r\nFully functional kitchen\r\ncooking and dining wares\r\nWardrobe\r\nQueen size bed',1,'Available',1,1,'Available','2025-05-15 12:26:41','Approved',2000692650,14.58739161,121.06286272),
(68,1000762105,'Rent studio condominium unit in McKinley Hill Taguig Metro Manila','Florence Way, McKinley Hill, Pinagsama, Taguig District 2, Taguig, Southern Manila District, Metro Manila, 1634, Philippines',22000.00,'Studio','Rent studio condominium unit in McKinley Hill Taguig Metro Manila has a laid-back ambiance, to soothe your busy day.\r\n\r\nThe unit is located on the 11th floor of Tower 3 Viceroy Residences. Viceroy Residences is just a few steps from the beautiful and romantic Venice Grand Mall.\r\n\r\nThis unit is just perfect for a single occupant or a couple. Whether you have a work-from-home setup or working in one of the business hubs in the area, the unit offers a cozy and straight-forward lifestyle.\r\n\r\nPlaces of interest:\r\n\r\nVenice Grand Mall\r\nPhilippine Army Gym\r\nPhilippine Army General Hospital\r\nChinese International School\r\nKorean International School Manila\r\nCognizant Philippines\r\nbanks and other business establishments.\r\nFeatures:\r\n\r\nFully equip and fully functional kitchen\r\nQueen size bed with pull-out single bed\r\n2-door personal fridge\r\nHot water system in the shower\r\nBuilt-in wardrobe',1,'Available',2,1,'Available','2025-05-15 13:03:02','Approved',2000476418,14.53293163,121.04964192),
(71,1000948954,'De Guzman\'s House','Masigasig Street, Barangay 178, Zone 15, Camarin, District 3, Caloocan, Northern Manila District, Metro Manila, 1423, Philippines',12000.00,'3 Bedroom','✅ Corner lot – Great visibility for businesses\r\n✅ Main road access – High foot traffic\r\n✅ Flood-free – Safe & secure location\r\n🛍 5 mins away to SM Fairview, Robinsons, and Fairview Terraces\r\n🏪 2 mins away to wet & dry markets\r\n🚖 Beside tricycle terminal',2,'Available',3,2,'Available','2025-08-26 15:16:04','Approved',2000377766,14.74491600,121.06206800),
(79,1000762105,'3BR Apartment Unit for Rent in Quezon City near La Salle Greenhills, ABD, San Juan City, Greenhills Shopping Center','14 Hilltop Drive, Horseshoe Village, QC',125000.00,'3 Bedroom','La Colline Suites - 14 Hilltop Drive, Horseshoe Village, QC\r\n\r\nat the boundary of Greenhills Village, San Juan City\r\n\r\n\r\n\r\n\r\nLa Colline Suites is a hidden oasis in the city. It is surrounded by a thick canopy of trees on all sides. The building is located just behind the San Juan Water Reservoir and a mere 5-minute walk to Robinson Magnolia Mall. It is only 20-minute drive to Ortigas Center and 10-minute drive to Greenhills Shopping Center, Santolan Town Center and Cubao Shopping District.\r\n',1,'Available',3,4,'Available','2025-09-12 11:57:01','Occupied',2000231540,14.61210936,121.04245874),
(93,1000762105,'Apartment for Rent at 20 Kamuning Road, Quezon City','20 Kamuning Rd, Diliman, Quezon City, Metro Manila',17000.00,'Studio','Discover comfort and convenience in this well-located apartment at 20 Kamuning Road, Quezon City. Situated beside Metrobank and opposite Generics Pharmacy, with Delgado Hospital as a nearby landmark, this apartment offers easy access to essential establishments and public transportation.  Ideal for professionals, students, or small families, this apartment provides a safe and accessible living space in the heart of Quezon City, Metro Manila.',1,'Available',1,1,'Available','2025-09-12 13:28:38','Occupied',2000847463,14.62800024,121.03670611),
(94,1000762105,'For Lease: Studio & 2 Bedroom Apartment, Talipapa Quirino - Novaliches, Q.C.','Talipapa, Quirino Highway, QC',10500.00,'Studio','For Rent: Studio & 2 Bedroom Apartment, Talipapa Quirino - Novaliches, Q.C.\r\n\r\nLocation:\r\n-Along Quirino Highway\r\n-Beside Waltermart & The Junction\r\n-4 minute walk to SM Hypermarket\r\n-22 minute drive to SM North & Trinoma\r\n\r\nStudio & 2 Bedroom\r\n-33 sqm\r\n-Bare\r\n-Ground Floor-3rd Floor\r\n-Ready for window-type aircon\r\n\r\nTerms:\r\n**PDCs required**\r\n-No pets please\r\n-Minimum 1 year lease\r\n-2 months deposit, 1 month advance\r\n-Utilities deposit: P15,000\r\n-Contract/rent starts maximum 9 days from date of reservation',1,'Available',2,2,'Available','2025-09-12 13:52:54','Occupied',2000912063,14.68405789,121.02237475),
(95,1000762105,'3-Storey ideal for Staff House, Dormitory and Caregiver Facility FOR LEASE in QC','Nayong Kanluran, Quezon City',700000.00,'House','FOR SALE/LEASE\r\n\r\n\r\n3 Storey Building Apartment, West Avenue Corner Del Monte, Quezon City\r\n\r\n\r\nIdeal for Staff House, Dormitory, and Caregiver Facility\r\nwith 3 Storey townhouse\r\nLot Area: 827 sqm\r\n47 studio units (14 sqm, 15 sqm & 18 sqm) with Cabinet and T&B\r\nGated: 7 parking area and 3 parking inside\r\n\r\n\r\nLease Price: Php 700K\r\nSelling Price: Php 200M\r\n\r\n\r\nBetty Ongsiaco Gorospe\r\nRE/MAX Capital\r\nPRC RES License No. 16330',3,'Available',47,15,'','2025-09-12 14:04:53','Occupied',2000893246,14.63979763,121.02419221),
(96,1000720659,'Extra Large 3BR for Rent in East Grace Park, Caloocan','East Grace Park, Caloocan, 7th avenue',38000.00,'3 Bedroom','5-storey residential/commercial building in the heart of Caloocan City, excellent location walking distance to 5thAvenue LRT, Monumento, wet market, and schools.\r\n\r\nOur unit (2nd Floor) come with 3 bedrooms, 2 bathrooms, extra large living room, complete kitchen cabinetry and bathroom fixtures. Freshly renovated, just bring your furniture and appliances and move-in to your new home. All units have individual water and Meralco meters. Water tanks are available to ensure uninterrupted water supply.',1,'Available',3,2,'Available','2025-09-12 15:34:24','Approved',2000436561,14.64766435,120.98454165),
(97,1000720659,'2 bedrooms townhouse for rent','Caloocan, Metro Manila, Sampaguita subdivision',12000.00,'2 Bedroom','FOR RENT ONLY\r\n2bedrooms\r\n1bathroom\r\n1car\r\nNear:\r\nBrixtonville\r\nBankers village\r\nSampaguita elementary school\r\nzabarte mall\r\nPuregold\r\n2month deposit 1months advance 1year contract with postdated checks',2,'Available',2,1,'Available','2025-09-12 15:40:55','Occupied',2000882657,14.77054875,121.03341901),
(98,1000720659,'Furnished, modern studio flat inside Valley Golf, Cainta For Rent','27 Molave Street, Cainta, Rizal',16000.00,'1 Bedroom','Condo-like, functional living spaces within an industrial styled house.\r\nOne, furnished unit available. 24 sqm FA.\r\n\r\n\r\nDecent house, ideal for work from home and for Rizal-based executive/s wanting the representation, convenience, warmth and privacy of a nice home.\r\n\r\n\r\nModern studio flat, with the following amenities:\r\n\r\n\r\nOpen living/dining and bed area\r\nPlatform bed base with queen mattress and pull out cabinet storage\r\n2 seater sofa\r\n2 seater quartz top dining set\r\nConsole table\r\nWalk-in closet\r\nSpacious',1,'Available',1,1,'Available','2025-09-12 15:59:47','Approved',2000110128,14.59023390,121.14228773),
(99,1000720659,'3 bedroom for rent in Eastwood Global Plaza','Eastwood Global Plaza, Eastwood Palm Tree Avenue, Quezon City, 1800 Metro Manila',80000.00,'3 Bedroom','Condo for rent in Eastwood City\r\n\r\n3 bedroom furnished\r\nin Eastwood Global Plaza\r\n\r\nFor rent eastwood condominium\r\n\r\n89sqm\r\nBest Rate: Php 80,000 a month\r\ninclusive of asso dues\r\n1 yr lease contract\r\n\r\nNO SUBLEASE\r\n\r\nNO PARKING\r\n\r\nTerm\r\n2 months advance\r\n2 months deposit ( strict)\r\nmust have PDC\r\n\r\n\r\nAvailable for viewing',1,'Available',3,3,'Available','2025-09-12 16:06:23','Approved',2000826162,14.60754470,121.08125620),
(100,1000845370,'3 Bedroom apartment Unit near Pasay Libertad LRT Station across Victory Mall (3rd floor)','Pasay City, Metro Manila, Park Avenue',25000.00,'3 Bedroom','Large 3 Bedroom Apartment with 1 toilet and bath.\r\n\r\nwith laundry balcony and  balcony views of Makati Skyline.\r\n2 large bedrooms and 1 smaller bedroom.\r\nWell ventilated and well lighted apartment.\r\nPets allowed only inside the unit. not along corridors.\r\nNo parking available on site. (you need to rent parking elsewhere)\r\nLocated on the 3rd Floor walk up.\r\nQuiet and secure community.\r\n\r\nWalking distance to Libertad LRT Station.\r\n\r\nThis apartment is right behind Eastwest Bank.',1,'Available',3,1,'Available','2025-09-12 16:41:13','Approved',2000787766,14.54328802,120.99849987),
(101,1000845370,'City center apartment for rent','Market Subdivision Upper, Baguio',50000.00,'2 Bedroom','This rental apartment has 2 bedrooms, 2 toilets and baths, office, living area, dining and kitchen, parking and a porch .\r\nIt is a walking distance to :\r\n- City Market\r\n- Grocery stores\r\n- Burnham Park\r\n- Malls\r\n-Session Road\r\n- school\r\n- different government offices and lots of others .\r\n\r\nContact Rhinehart Realty for further details and for an ocular visit.\r\nDetails\r\nGarage\r\nBalcony\r\nPanoramic view\r\nFireplace\r\nWater\r\nFully furnished\r\nInternet\r\nIntegral kitchen\r\nBuilt-in wardrobe\r\nOffice room\r\nElectricity',1,'Available',2,2,'Available','2025-09-12 16:48:08','Approved',2000864745,16.41626747,120.59370840),
(102,1000845370,'Newly-Built Two Bedroom Apartment with Parking for Rent in Pasig','Santa Lucia, Pasig',28000.00,'2 Bedroom','80 sqm total floor area more or less\r\n\r\nCozy and modern design\r\n\r\nBathroom with toilet and bath\r\n\r\nKitchen area with counters\r\n\r\nService/laundry area at the back\r\n\r\nSpacious living and dining area\r\n\r\nSpacious master bedroom\r\n\r\n2nd Bedroom\r\n\r\nSeparate electric and water meters per unit\r\n\r\nComes with 1 parking space each unit\r\n\r\nSecured perimeter fence\r\n\r\nNewly constructed apartment building in 2024\r\n\r\nAccessible via East Bank Road from Ortigas Avenue Extension or De Castro Subdivision\r\n\r\nnear SM East Ortigas',2,'Available',2,1,'Available','2025-09-12 16:58:05','Approved',2000349746,14.58440398,121.09668589),
(103,1000845370,'3 Bedroom Corner Apartment unit in Pasay City for rent near Libertad LRT Station','San Rafael, Pasay',32000.00,'3 Bedroom','Large 3 bedroom unit located right across Victory Pasay Mall located on the 2nd floor.\r\n\r\nFloor area : 90sqm\r\n\r\n\r\n\r\n\r\n\r\n3 bedroom with 2 toilets and bath.\r\n\r\nwith views of Libertad St.(A. Arnaiz Ave) and Victory Pasay Mall.\r\n\r\nwith large living area and dining area, with large dirty kitchen.\r\n\r\nfor family use only. not for commercial nor for staff housing.\r\n\r\nwalking distance to Libertad LRT station.\r\n\r\nlocated right across Victory Pasay Mall & Pasay Public Market.\r\n\r\n2 months deposit, 1 month advance',1,'None',3,2,'Available','2025-09-13 11:07:42','Approved',2000851463,14.54546381,120.99710083),
