INSERT INTO `property_health_history` VALUES
(10,2000476418,40,'A bed bug infestation in the bedroom poses a significant health and comfort risk, requiring immediate professional intervention to prevent further spread and potential property damage. These pests multiply rapidly and are notoriously difficult to eliminate without specialized treatment, making prompt action essential to avoid escalating costs and prolonged discomfort. Infestations can lead to itchy bites, allergic reactions, and psychological distress, while also potentially damaging furniture and fabrics if not addressed quickly. The overall property health is severely impacted due to the invasive nature and health implications of this pest issue.','2025-10-16 12:29:46','Immediately contact a licensed pest control professional to conduct a thorough inspection and develop a comprehensive treatment plan, which will likely include chemical treatments, heat treatments, or a combination approach. All bedding, clothing, and soft furnishings should be washed in hot water and dried on high heat, while non-washable items should be sealed in plastic bags and treated professionally. Consider using mattress and pillow encasements designed to trap bed bugs, and reduce clutter in the bedroom to eliminate hiding spots. Monitor for any signs of re-infestation for several months after treatment, as bed bugs can be persistent.','Without immediate professional intervention, the bed bug population will likely double every 16 days, leading to a more widespread and costly infestation within 2-3 months that may require multiple treatment cycles. The risk of transferring bed bugs to other areas of the home or to personal belongings increases substantially over time, potentially turning a localized issue into a full-blown home-wide problem. Health impacts such as sleep disruption and skin reactions will intensify as the infestation grows, potentially requiring medical attention. Expect the overall property value to decrease temporarily due to the stigma associated with bed bug infestations, making disclosure necessary during any potential sale or rental process.',1),
(11,2000476418,60,'Your home\'s electrical system shows signs of wear, particularly with loose or broken outlets in the bedroom. These issues pose a safety risk and should be addressed promptly to prevent electrical hazards or potential fires. While not yet critical, these electrical problems can worsen over time, leading to more extensive repairs or safety concerns. Addressing these issues now can prevent minor inconveniences from becoming major safety hazards.','2025-10-16 12:37:41','It is recommended to have a licensed electrician inspect and repair or replace any loose or broken outlets in your bedroom. Do not attempt to fix electrical issues yourself unless you are a trained professional. Consider upgrading to modern tamper-resistant outlets for added safety. Schedule this repair as soon as possible to maintain the integrity of your electrical system and ensure your home remains safe.','If left unaddressed, loose or broken outlets may lead to increased electrical resistance, which can cause overheating and potentially start a fire. Over time, the problem may worsen, potentially damaging connected devices and creating more extensive repair needs. Regular electrical inspections can help catch such issues early and prevent costly repairs or safety incidents. Addressing these issues now will likely involve a straightforward repair, but delaying could lead to more complex and expensive solutions down the line.',1),
(13,2000476418,62,'Your home\'s overall condition is moderately healthy but requires immediate attention to appliance functionality to prevent further damage and unexpected expenses. The washing machine failure represents a significant disruption, while the dirty air filters indicate a need for routine upkeep to maintain air quality and system efficiency. Addressing these issues promptly can prevent minor problems from escalating into costly repairs or replacements. Regular maintenance will help extend the lifespan of your appliances and ensure a comfortable living environment.','2025-10-17 22:15:08','Prioritize repairing or replacing the washing machine to restore laundry functionality and avoid water damage or mold issues. Clean or replace the air filters immediately to improve indoor air quality and reduce strain on your HVAC system. Consider having a professional inspect the water heater to diagnose the heating issue and provide repair or replacement options. Establish a regular maintenance schedule for all appliances, including filter changes and annual inspections, to prevent future failures and extend their operational life.','If left unaddressed, the washing machine issue could lead to further mechanical failure or water damage to your floors, potentially increasing repair costs significantly. Dirty air filters will continue to degrade air quality, increase energy consumption, and may cause premature wear on your HVAC system. The water heater\'s heating problem could worsen, resulting in complete failure and requiring an emergency replacement. By addressing these issues now, you can avoid unexpected breakdowns, reduce long-term costs, and maintain the efficiency and safety of your home systems.',1),
(14,2000476418,30,'The health of your bedroom is severely compromised due to a bed bug infestation, which poses immediate health risks and property damage. Bed bugs multiply rapidly and can spread throughout the home if not addressed promptly. Their presence can lead to allergic reactions, sleep disturbances, and significant stress for occupants. Without intervention, this issue will likely worsen, requiring more extensive and costly measures to resolve in the future.','2025-10-18 01:39:09','Immediate action is necessary to eliminate the bed bug infestation. Consult a professional pest control service for a thorough inspection and tailored treatment plan, as DIY methods are often ineffective against widespread infestations. Launder all bedding, curtains, and clothing in hot water and dry on high heat to kill any bugs and eggs. Vacuum the entire room, including mattresses, furniture, and cracks, and dispose of the vacuum bag immediately. Consider using mattress encasements and regular inspections to prevent future infestations.','If left untreated, the bed bug infestation will likely spread to other rooms within 6–12 months, exponentially increasing the cost and complexity of eradication. Health impacts such as bites and allergic reactions may become more severe, potentially requiring medical attention. Without professional intervention, the infestation could persist indefinitely, making your bedroom uninhabitable. Early treatment is critical to limit the spread and reduce the overall financial and health burden.',1),
(15,2000476418,50,'The bedroom is experiencing a significant pest infestation problem, which has substantially lowered the overall health score to a moderate level. This issue poses potential health risks and discomfort, and if left unaddressed, could escalate into a more severe problem requiring costly interventions. Immediate action is recommended to mitigate further damage and restore a safe living environment. The absence of a definitive remaining lifespan or cost estimate highlights the variable nature of pest control solutions depending on the extent of infestation.','2025-10-18 01:43:29','Promptly consult a professional pest control service to assess the extent of the infestation and develop a targeted eradication plan. Implement preventive measures such as mattress encasements, regular vacuuming, and washing bedding in hot water to contain and eliminate bed bugs. Monitor the situation closely and consider scheduling follow-up treatments to ensure complete eradication. Maintain cleanliness and clutter-free surroundings to minimize hiding places for pests.','If not addressed immediately, the pest infestation is likely to worsen, potentially spreading to other areas of the home and increasing the complexity and cost of eradication. Over time, this could lead to increased health concerns, including skin reactions and sleep disturbances. The presence of bed bugs may also negatively impact property value and require more intensive chemical or heat treatments in the future. Early intervention will significantly improve the prognosis for a complete and cost-effective resolution.',1),
(16,2000476418,80,'The bedroom is in generally good condition, but there is a concerning issue with a potential bug infestation. This is a serious concern that requires prompt attention to prevent further complications. The lack of specified years in use makes it difficult to assess the full extent of the issue. Overall, proactive measures are needed to maintain the home\'s health and comfort.','2025-10-18 01:47:26','Immediately consult a pest control professional to identify and treat the suspected bug infestation. Thoroughly clean and vacuum all bedding, furniture, and carpets to eliminate any pests or eggs. Consider using bed bug mattress encasements to prevent further spread. Regularly inspect the bedroom for signs of pests and maintain good hygiene practices to avoid future infestations.','If treated promptly, the infestation can be resolved with minimal disruption to your daily life. Without intervention, the issue will likely worsen, potentially spreading to other rooms and causing more significant damage. Future infestations can be prevented with regular cleaning and professional inspections. The long-term health of the bedroom will depend on how effectively this current issue is managed.',1),
(17,2000476418,65,'The property has a significant bed bug infestation issue in the bedroom, which poses health risks and requires immediate attention. Bed bugs can cause skin irritation, allergic reactions, and psychological distress, and they spread quickly if left untreated. The infestation is likely to worsen over time, potentially affecting other rooms and making eradication more difficult and costly. While the issue is currently contained to the bedroom, proactive action is essential to prevent escalation and maintain a living environment.','2025-10-18 01:50:47','Professional pest control treatment is highly recommended to eliminate the bed bug infestation effectively. All bedding, clothing, and fabrics in the bedroom should be washed in hot water and dried on high heat to kill any eggs or remaining bugs. Sealing cracks and crevices in walls, floors, and furniture can help reduce hiding places and prevent reinfestation. Regular inspections, especially after travel or bringing used furniture into the home, are advised to catch any future infestations early.','Without intervention, the bed bug infestation will likely spread to adjacent rooms within 2-3 months, increasing the complexity and cost of eradication. The infestation may also lead to tenant turnover or decreased property value if not addressed promptly. Over time, the psychological impact on occupants could increase, potentially resulting in stress and sleep disturbances. If treated professionally, the infestation can be resolved within 1-2 treatments over 4-6 weeks, but vigilance is needed to prevent recurrence.',1),
(18,2000476418,30,'The presence of bed bugs or other pests in the bedroom poses a serious health and comfort risk. These infestations multiply rapidly and are notoriously difficult to eradicate without professional intervention. The issue significantly compromises the habitability and safety of the entire room, potentially spreading to other areas of the home. Immediate and thorough action is required to prevent worsening conditions and potential health issues such as skin irritation and allergic reactions.','2025-10-18 01:53:10','Begin by thoroughly inspecting all furniture, linens, and crevices for signs of bed bugs, such as small reddish-brown spots or shed skins. Wash all fabrics in hot water and dry them on the highest heat setting, and consider using a steamer on upholstery and mattresses. Seal all infested items in plastic bags and dispose of them properly. Engage a professional pest control service for a comprehensive inspection and treatment, as DIY methods are often insufficient to eliminate the entire infestation population.','If left untreated, the bed bug infestation will likely spread to other bedrooms and common areas, creating a much larger and more costly problem. Eradication will almost certainly require multiple professional treatments over several weeks, with a high probability of needing follow-up visits to eliminate any surviving eggs. Successfully resolving this issue will restore the room\'s comfort and safety, but the process will be disruptive and could take several weeks to fully complete. Without professional help, the infestation may persist for months or even years.',1),
(20,2000476418,50,'The property shows moderate health with a critical pest infestation issue in the bedroom. Bed bugs are not only a nuisance but also pose health risks through bites and potential allergic reactions. Immediate action is required to prevent the infestation from spreading to other areas of the home. While the structural and other systems appear sound, this pest issue significantly impacts overall livability and requires prompt professional treatment.','2025-10-18 02:22:47','Engage a licensed pest control service for a thorough inspection and targeted treatment. Wash all bedding, clothing, and fabrics in hot water and dry on high heat to kill any eggs or bugs. Consider using mattress encasements and vacuuming the entire room, including furniture crevices, to remove any remaining pests. Monitor the area closely for several weeks to ensure the infestation is fully eradicated and prevent future occurrences.','Without intervention, the bed bug infestation will likely worsen within 1-2 months, potentially spreading to adjacent rooms and increasing treatment costs. Professional pest control typically costs ₱5,000–₱15,000 for initial treatment, with follow-up visits every 2-3 weeks needed to ensure complete eradication. If untreated, the infestation could persist indefinitely and may eventually require fumigation or complete room replacement, costing significantly more. Early action is the most cost-effective approach to resolve this issue quickly.',1),
(21,2000719074,88,'The home is in generally good condition with most components performing well. The washing machine is showing signs of wear and will likely need replacement soon, which is the primary concern. Other items like the bedframe and ventilation fan are relatively new and do not pose immediate risks, but routine cleaning and monitoring are recommended. Addressing the washing machine proactively can prevent more significant inconvenience and potential water damage.','2025-10-18 02:23:34','Replace the washing machine within the next year to avoid unexpected breakdowns and costly emergency repairs. Clean the ventilation fans regularly to maintain air quality and prevent dust buildup. Inspect the bedframe periodically for any signs of wear, though it is still relatively new. Consider setting aside a maintenance fund for future appliance replacements to manage costs effectively.','The washing machine is expected to fail within the next 10 years, so budgeting for a replacement now is advisable. The bedframe and ventilation fan should continue to function well for several more years with proper care. If the washing machine is not replaced, it could lead to water leaks or mold growth, resulting in additional repair costs. Overall, the home\'s condition will remain stable if these recommendations are followed.',1),
(22,2000864745,50,'The property has moderate issues that require prompt action to prevent further deterioration. The presence of bed bugs and loose outlets pose risks to health and safety, respectively. These problems, while not immediately catastrophic, can escalate if left unaddressed. Immediate treatment and repairs are recommended to restore the property to a good condition and avoid higher costs later.','2025-10-18 14:46:43','Schedule professional pest control services to eliminate bed bugs thoroughly, as DIY methods are often ineffective. Have a licensed electrician inspect and repair all loose outlets to prevent fire hazards and ensure electrical safety. Consider sealing cracks and crevices where bed bugs might hide to prevent future infestations. Regular maintenance checks should be implemented to catch similar issues early.','If left untreated, the bed bug infestation will likely spread to other areas of the home, increasing both the difficulty and cost of eradication. Loose outlets may lead to electrical malfunctions, posing a serious safety risk and potential fire hazard. Addressing these issues now will prevent further damage and maintain the property\'s livability. Without intervention, the overall condition of the bedroom may decline significantly within the next 1-2 years.',1),
(23,2000864745,66,'The property has several issues that need attention across the bedroom and living room areas. The most critical issues are the potential bed bug infestation and mold growth on walls, both of which pose health risks and require immediate action. The broken outlets and non-functional ceiling fan are safety and comfort concerns that should be addressed promptly. While these issues are manageable, they collectively reduce the property\'s overall health score and indicate a need for maintenance investment.','2025-10-18 14:49:02','It is highly recommended to conduct a thorough pest inspection to confirm or rule out bed bugs and implement appropriate treatment if needed. The mold on walls should be professionally assessed and remediated to prevent health issues and structural damage. All electrical outlets should be checked and repaired by a licensed electrician to ensure safety. The ceiling fan should be repaired or replaced to restore comfort and air circulation. Addressing these issues will improve the property\'s condition, value, and livability.','If left unaddressed, the bed bug infestation could spread and become more difficult and expensive to eliminate over time. The mold is likely to grow and spread, potentially causing structural damage and health problems. The broken outlets pose an ongoing safety hazard and may lead to electrical issues. The non-functional ceiling fan will continue to reduce comfort, especially during hot weather. Prompt action can prevent these issues from escalating and reduce long-term costs.',1),
(24,2000864745,0,'Your home is currently on fire, posing an immediate and extreme threat to life, safety, and property. This is not a maintenance issue but a life-threatening emergency requiring urgent intervention to prevent catastrophic damage or loss of life. Immediate evacuation and firefighting efforts are the only priorities; all other aspects of home health are irrelevant in this context. Do not attempt to assess or address any other issues until the fire is fully extinguished and the structure is declared safe by professionals.','2025-10-18 14:51:51','Leave the house immediately and call emergency services (911 or local fire department) without delay. Do not re-enter the building until firefighters confirm it is safe. Contact your insurance company as soon as possible to report the incident and initiate claims processes. Once the fire is out, hire a licensed professional to assess structural integrity before reoccupation. Consider temporary housing arrangements until the property is deemed habitable again by experts.','If not properly extinguished, the fire will likely result in complete destruction of the structure and total loss of contents. Even after extinguishment, smoke damage, water damage from firefighting, and structural weakening will render the home uninhabitable for an extended period, possibly requiring major reconstruction. Insurance coverage will depend on your policy details, but most standard policies cover fire damage minus deductibles. Without immediate action, the risk of injury or death is extremely high.',1),
(25,2000864745,0,'Your home is currently facing a critical emergency as it is actively burning. Immediate evacuation is required for your safety. This situation poses an extreme and immediate threat to life and property, making occupation impossible. Fire damage can spread rapidly, destroying structural elements and releasing toxic smoke. Do not attempt to re-enter the building until emergency responders declare it safe. Immediate action is needed to prevent loss of life and minimize property damage.','2025-10-18 14:53:12','Evacuate the premises immediately and call emergency services (911 or local equivalent) from a safe distance. Once the fire is extinguished and the area is deemed safe by authorities, consult with a certified fire damage restoration specialist. Do not re-enter the building until it has been professionally inspected for structural integrity and hazardous materials. Contact your insurance company immediately to begin the claims process and document all damage with photos and videos.','If not addressed, the fire will likely lead to total destruction of the residence. Occupancy of the home will be impossible until extensive repairs are completed, which could take weeks or months. The structure may require partial or complete rebuilding. There is a high risk of long-term issues like mold growth and electrical system damage even after the fire is extinguished. The cost to repair or rebuild will be substantial, potentially exceeding the value of the home.',1),
(26,2000864745,70,'Your home is in good overall condition, with no immediate major concerns requiring urgent attention. The main issue is a leaky faucet in the kitchen, which is a minor but persistent problem that can lead to water waste and increased utility bills if not addressed. While this does not pose a structural or safety risk, it is important to address it promptly to prevent further complications such as water damage to cabinetry or countertops. Overall, your home maintains a solid health score, indicating that routine maintenance and repairs will keep it in good shape for years to come.','2025-10-18 15:09:09','Repair the leaky faucet in the kitchen as soon as possible to conserve water and avoid potential water damage to surrounding surfaces. Consider hiring a professional plumber if you are not familiar with faucet repairs, as improper installation can exacerbate the issue. Monitor other faucets in the home for similar signs of wear or leaks, and plan to inspect all plumbing fixtures annually to catch early issues. Budget for routine maintenance tasks such as cleaning faucet aerators and checking for drips to prolong the lifespan of your plumbing components.','If the leaky faucet is repaired promptly, it should continue to function normally for several more years without requiring major work. Left unrepaired, the leak could worsen over time, potentially leading to higher water bills and potential damage to cabinetry or flooring beneath the sink. Other components in the home are expected to perform well with regular care, suggesting no significant repairs or replacements will be needed in the near future. Overall, maintaining your home with consistent minor repairs will help preserve its current good condition and avoid more costly issues down the line.',1),
(27,2000864745,65,'Your home shows signs of roof leaks during rain, which indicates potential deterioration of roofing materials or improper installation. This issue can lead to water damage, mold growth, and structural compromise if not addressed promptly. The leaks suggest that the roof may not be effectively protecting your home from moisture intrusion, requiring inspection and repair. Addressing this now can prevent more extensive damage and costly repairs down the line.','2025-10-18 15:28:22','Inspect the roof thoroughly to identify the source of the leaks, whether it\'s damaged shingles, flashing, or underlayment. Consider hiring a professional roofer to assess the extent of the damage and recommend appropriate repairs or replacement if necessary. Ensure proper attic ventilation to reduce moisture buildup that can exacerbate roof deterioration. Monitor the roof after heavy rains to track any recurring leaks and address them immediately.','If left unaddressed, roof leaks can worsen over time, leading to more significant water damage, mold growth, and compromised structural integrity. Repairing the leaks now may extend the roof\'s lifespan by several years, but replacement might be necessary if the damage is extensive. Without intervention, the issue is likely to escalate, resulting in higher repair costs and potential health hazards from mold. Future maintenance should include regular inspections, especially after severe weather events.',1),
(28,2000864745,80,'Your home is in good overall condition with three minor issues that require attention. The bed bug infestation, while not yet active, poses a potential health risk if left unaddressed, and prompt preventive measures are recommended. The electrical outlet issue is a safety concern that should be resolved immediately to prevent hazards, though it is localized and does not affect the entire home structure. The leaky faucet, while annoying, is easily fixable and does not indicate broader plumbing problems, though water waste and potential mold growth are secondary concerns. None of these issues significantly compromise your home\'s structural integrity or safety at this time.','2025-10-18 15:32:34','For the bed bug issue, inspect all bedroom furniture and textiles thoroughly, and consider using mattress encasements or professional pest control as a preventive measure. Address the loose outlet immediately by having a licensed electrician inspect and tighten or replace it to ensure electrical safety, as DIY repairs could be dangerous. Fix the leaky faucet by replacing worn washers or cartridges, or hire a plumber if you\'re not comfortable with DIY plumbing, to prevent further water waste and potential damage. Regularly monitor all three areas for changes, and address any new signs promptly to maintain your home\'s good condition.','If left unaddressed, the bed bug issue has a 40% chance of becoming a full infestation within 12-18 months, leading to costly extermination and potential health issues. The electrical outlet may continue to loosen over time, increasing the risk of short circuits or fires, especially if regularly used by high-draw appliances. The leaky faucet will likely worsen gradually, potentially leading to higher water bills and minor water damage around the sink if not repaired within the next 6 months. With prompt attention to all three issues, your home should maintain its current good health score for the next 2-3 years.',1),
(29,2000864745,65,'Your bedroom has a moderate health score primarily due to a bed bug infestation. This pest issue is a significant concern as it can lead to health problems, discomfort, and property damage if not addressed promptly. The infestation can spread throughout your home, affecting other areas and potentially increasing remediation costs and complexity. Immediate action is recommended to prevent the problem from worsening and to restore a healthy living environment.','2025-10-18 15:36:44','For the bed bug infestation, consider hiring a professional pest control service for thorough inspection and treatment. Heat treatment or targeted chemical applications may be necessary to eliminate the pests completely. Launder all bedding, clothing, and fabrics at high temperatures, and vacuum the entire room thoroughly, including mattresses, furniture, and carpets. Use mattress and pillow encasements to trap any remaining bugs and prevent future infestations. Regularly inspect sleeping areas and maintain cleanliness to deter re-infestation.','If left untreated, the bed bug infestation is likely to spread to other rooms, increasing the complexity and cost of eradication. Within 3-6 months, you may notice increased bites, skin irritation, and potential allergic reactions among household members. The presence of bed bugs can also lead to stress, sleep disturbances, and decreased quality of life. Professional treatment typically costs ₱5,000–₱15,000 and may require follow-up visits, but failure to address this could result in long-term infestation and higher remediation costs later.',1),
(30,2000864745,60,'The bedroom shows signs of a potential bed bug infestation, which poses moderate risks to health and comfort. While the issue is not immediately life-threatening, it requires prompt attention to prevent escalation and potential property damage. The infestation can lead to skin irritation, allergic reactions, and psychological distress if left untreated. Addressing this now will help maintain a livable environment and avoid higher costs or more extensive treatments later.','2025-10-18 16:42:14','Immediately contact a professional pest control service to inspect and confirm the presence of bed bugs. Do not attempt DIY treatments, as they often fail and can spread the infestation. Launder all bedding, clothing, and fabrics in hot water and dry on high heat. Vacuum thoroughly, including mattresses, furniture, and carpets, and dispose of the vacuum bag immediately. Consider using mattress encasements and monitor for any signs of reinfestation. Sealing cracks and crevices in walls and furniture can also help prevent future infestations.','If not addressed within the next few weeks, the bed bug infestation is likely to spread to other rooms, making eradication more difficult and costly. The problem may intensify, leading to increased discomfort and potential health issues. Without intervention, you may face additional expenses for extensive pest control, replacement of infested items, and potential medical bills. Timely action can minimize these risks and restore the bedroom to a comfortable, pest-free state within 1-2 months.',0),
(31,2000864745,0,'The property has a critical issue requiring immediate attention. The issue involves identification of a person, which is unrelated to standard property maintenance indicators. No lifespan or cost data is available for this type of issue. Due to the lack of relevant information, the health score is defaulting to zero. Immediate resolution is advised to ensure proper identification protocols are followed.','2025-10-18 16:46:53','Verify the identity of the person in question through official documentation or authoritative sources. If this is a security concern, contact local authorities immediately. Document all findings and actions taken for record-keeping. Consider implementing a formal identification process to prevent such ambiguities in the future.','If unresolved, this issue could lead to potential security risks or legal complications. The uncertainty surrounding the identity may delay necessary approvals or actions. Without clear resolution, other property assessments cannot proceed accurately. It is crucial to address this matter promptly to restore normalcy and prepare for future property evaluations.',0),
(32,2000476418,83,'Your home\'s electrical and plumbing systems show minor issues that require prompt attention. The loose outlets in the bedroom pose a safety risk and should be repaired immediately to prevent electrical hazards. The leaky faucet in the bathroom, while not urgent, can lead to water waste and higher utility bills if left unaddressed. Both issues are relatively inexpensive to fix but could escalate in cost or severity if ignored. Addressing these now will prevent further damage and maintain your home\'s overall functionality and safety.','2025-10-19 21:47:34','Prioritize repairing the loose outlets in the bedroom as soon as possible to eliminate any fire or shock risks. For the bathroom faucet, consider replacing worn washers or seals to stop the leak and conserve water. Schedule a professional electrician to inspect all outlets for wiring integrity and proper grounding. Monitor the faucet\'s drip rate and collect water in a container to quantify waste before repairs. Keep records of maintenance dates for future reference and to track ongoing issues.','If left unrepaired, the loose outlets may eventually cause intermittent power loss, overheating, or even electrical fires within 1-2 years. The leaky faucet will likely worsen over time, potentially damaging fixtures or causing mold growth in damp areas. Water wastage could increase your monthly bills by 5-10% if the drip rate accelerates. Both repairs are cost-effective now but could require full replacements costing 3-4 times more if delayed beyond their recommended lifespans. Addressing these issues promptly will extend the usable life of your electrical and plumbing systems.',1),
(33,2000847463,50,'The bedroom has a bed bug infestation issue, which is a significant problem that requires immediate attention. Bed bugs are not only a nuisance but can also cause health issues such as allergic reactions and sleep disturbances. Without intervention, the infestation can spread quickly to other rooms in the house, worsening the problem over time. Prompt action is needed to eliminate the pests and restore a healthy living environment.','2025-10-19 23:57:35','You should contact a professional pest control service to assess the extent of the infestation and develop a treatment plan. Thoroughly clean and vacuum all areas of the bedroom, including furniture, mattresses, and carpets, and wash all bedding in hot water. Consider using mattress encasements to trap any remaining bed bugs and prevent future infestations. Regularly inspect the bedroom for signs of bed bugs, such as bites, fecal stains, or shed skins, to catch any resurgence early.','If left untreated, the bed bug infestation will likely worsen, potentially spreading to other rooms and increasing the difficulty and cost of eradication. Professional pest control typically requires multiple treatments over several weeks to fully eliminate the problem. After successful treatment, the bedroom should remain pest-free with ongoing preventive measures. Neglecting this issue could lead to chronic infestations and significant discomfort for occupants.',1),
(34,2000893246,50,'Your home\'s overall health is moderate, primarily due to a bed bug infestation in the bedroom. This issue poses significant health and comfort risks if left unaddressed. While the infestation is currently localized, it can quickly spread and affect other areas. Immediate action is recommended to prevent escalation and potential health complications.','2025-10-20 00:06:10','Prioritize professional pest control services to eliminate the bed bug infestation thoroughly. Consider washing all bedding and clothing in hot water and vacuuming the entire bedroom, including mattresses and furniture. Continue monitoring for signs of reinfestation, such as bites or visible bugs. Maintain cleanliness and reduce clutter to minimize hiding spots for pests in the future.','Without intervention, the bed bug infestation will likely worsen within 1-3 months, spreading to other rooms and increasing treatment costs. If addressed promptly, the infestation can be resolved within 2-4 weeks with professional help. Delaying treatment could lead to health issues like skin infections and psychological stress from persistent bites. Over time, untreated infestations may also decrease property value and require more extensive remediation.',1),
(35,2000476418,85,'The property is in generally good condition with no major structural or safety concerns, but requires attention to minor electrical and plumbing issues. The loose or broken outlets in the bedroom pose a potential safety hazard and should be repaired promptly to prevent electrical shock or fire risks. The clogged bathroom drain, while not immediately critical, will worsen over time if left unaddressed, leading to unpleasant odors, water damage, or more expensive repairs. Addressing these issues now will help maintain the property\'s overall value and functionality, ensuring a safe and comfortable living environment.','2025-10-20 20:20:34','Prioritize repairing the loose or broken outlets in the bedroom as soon as possible by hiring a licensed electrician to ensure proper wiring and compliance with safety standards. For the clogged bathroom drain, try using a plunger or enzymatic drain cleaner first; if the clog persists, call a plumber to inspect and clear the drain line to prevent future backups. Schedule regular maintenance for both electrical and plumbing systems to catch similar issues early, such as checking outlets for tightness and monitoring drain performance. Consider upgrading to GFCI outlets in the bathroom and kitchen for enhanced safety, even if not currently required.','If the electrical outlets are not repaired, there is a moderate risk of malfunction that could escalate to a safety hazard, potentially resulting in electrical shocks or internal wire damage over the next 1–2 years. The clogged drain is likely to worsen gradually, with complete blockage possible within 6–12 months if left untreated, leading to flooding or pipe damage. Both issues are relatively inexpensive to fix now but may become more costly if neglected—electrical repairs could double in price if complications arise, and drain clearing might require more invasive methods like hydro-jetting. Addressing these promptly will extend the lifespan of the affected systems and prevent secondary issues like mold growth or wall damage.',1),
(36,2000847463,93,'The home is in overall good condition with two minor electrical and plumbing issues that do not pose immediate safety risks. The loose outlets in the bedroom and leaky faucet in the bathroom are both easily fixable with professional intervention. Addressing these now will prevent more extensive damage and higher costs in the future. Regular maintenance of these systems will help maintain the home\'s value and functionality.','2025-10-20 23:55:36','Schedule a licensed electrician to inspect and repair the bedroom outlets to ensure safe electrical connections. For the bathroom faucet, hire a plumber to replace worn washers or the entire cartridge if necessary. Consider upgrading to water-efficient fixtures while repairing the faucet to reduce water usage and lower utility bills. Implement a regular maintenance schedule for plumbing and electrical systems to catch small issues early.','If repaired promptly, the loose outlets should last the remaining lifespan of the home with no further issues. The faucet repair should resolve the leak for at least 5-7 years, though replacement may be more cost-effective if the fixture is very old. Neglecting these issues could lead to higher repair costs, water damage, or electrical hazards over the next 1-3 years. The home\'s overall health score should remain above 90 if these minor issues are addressed.',0),
(37,2000912063,55,'The home health assessment identifies a critical pest issue in the Bedroom category. The bed bug infestation poses significant health and comfort risks that require immediate attention. Without intervention, the problem can spread to other areas and cause sleep disturbances, allergic reactions, and psychological stress. Professional treatment is strongly recommended to eliminate the infestation and prevent further complications.','2025-10-21 12:59:45','1. Contact licensed pest control professionals for immediate treatment. 2. Wash all bedding, curtains, and clothing in hot water. 3. Thoroughly vacuum carpets and upholstery. 4. Consider temporary relocation during treatment. 5. Implement preventative measures like mattress encasements. 6. Monitor for recurring signs of infestation weekly.','If untreated, the infestation may persist for multiple years and spread to adjacent rooms. Success rates for professional treatment are 80-90% when properly executed. The infestation could lead to secondary issues like skin infections or severe sleep deprivation. Post-treatment, the home should be bed bug-free for 2-5 years depending on prevention efforts.',1),
(38,2000912063,82,'The home is in generally good condition, but there are a few maintenance and cleanliness issues that should be addressed to prevent further problems and maintain a healthy living environment. The bedroom has a potential bed bug infestation, which requires immediate attention to avoid spreading and health complications. The bathroom has a clogged drain that could lead to water damage and unpleasant odors if not cleared promptly. Additionally, dirty air filters in the HVAC system can reduce air quality and system efficiency, potentially leading to higher energy costs and respiratory issues. Overall, addressing these issues promptly will help maintain the home\'s value and ensure a comfortable living space.','2025-10-22 01:23:23','For the bedroom, consider hiring a professional pest control service to inspect and treat the bed bug infestation thoroughly, as DIY methods may not be effective. In the bathroom, use a plunger or enzymatic drain cleaner to address the clog, and if the problem persists, call a plumber to prevent potential water damage. Replace the dirty air filters with new ones of the correct size and consider setting a regular schedule to change them every 1-3 months depending on usage and air quality. Regular maintenance and prompt attention to these issues will help avoid larger problems and keep the home in excellent condition.','If left untreated, the bed bug infestation could spread to other rooms and become more difficult and expensive to eradicate, potentially costing ₱10,000 – ₱30,000 for professional treatment. The clogged drain may worsen, leading to slow drainage, foul odors, or even flooding, which could result in repair costs of ₱2,000 – ₱5,000 if water damage occurs. Dirty air filters will continue to reduce indoor air quality, exacerbating allergies and increasing energy bills by 10-15%; replacing them now will cost ₱200 – ₱500. Addressing these issues promptly will likely resolve the problems with minimal cost and restore the home\'s health score to 90+ within a few months.',0);
